private static void writeBlocks(final Block[] blocks,
    final DataOutput out) throws IOException {
  if (blocks == null) {
    out.writeInt(0);
  } else {
    out.writeInt(blocks.length);
    for (Block blk : blocks) {
      blk.write(out);
    }
  }
}
